                  "\u001b[32m+\u001b[m\u001b[32mSetting Command Options\u001b[m\n\u001b[32m+\u001b[m\u001b[32m~~~~~~~~~~~~~~~~~~~~~~~\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mClick is configured to load default values for command options from\u001b[m\n\u001b[32m+\u001b[m\u001b[32menvironment variables. The variables use the pattern\u001b[m\n\u001b[32m+\u001b[m\u001b[32m``FLASK_COMMAND_OPTION``. For example, to set the port for the run\u001b[m\n\u001b[32m+\u001b[m\u001b[32mcommand, instead of ``flask run --port 8000``:\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m.. code-block:: none\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    export FLASK_RUN_PORT=8000\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    flask run\u001b[m\n\u001b[32m+\u001b[m\u001b[32m     * Running on http://127.0.0.1:8000/\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mThese can be added to the ``.flaskenv`` file just like ``FLASK_APP`` to\u001b[m\n\u001b[32m+\u001b[m\u001b[32mcontrol default command options.\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\n",
