                path: "docs/errorhandling.rst",
                rawChanges:
                  "\u001b[31m-<https://www.getsentry.com/>`_ for dealing with application errors.  It's\u001b[m\n\u001b[32m+\u001b[m\u001b[32m<https://sentry.io/>`_ for dealing with application errors.  It's\u001b[m\n\u001b[31m-<https://github.com/getsentry/sentry>`__ and is also available as a `hosted version\u001b[m\n\u001b[31m-<https://getsentry.com/signup/>`_ which you can try for free. Sentry\u001b[m\n\u001b[32m+\u001b[m\u001b[32m<https://github.com/getsentry/sentry>`_ and is also available as a `hosted version\u001b[m\n\u001b[32m+\u001b[m\u001b[32m<https://sentry.io/signup/>`_ which you can try for free. Sentry\u001b[m\n\u001b[31m-To use Sentry you need to install the `raven` client with extra `flask` dependencies::\u001b[m\n\u001b[32m+\u001b[m\u001b[32mTo use Sentry you need to install the `sentry-sdk` client with extra `flask` dependencies::\u001b[m\n\u001b[31m-    $ pip install raven[flask]\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    $ pip install sentry-sdk[flask]\u001b[m\n\u001b[31m-    from raven.contrib.flask import Sentry\u001b[m\n\u001b[31m-    sentry = Sentry(app, dsn='YOUR_DSN_HERE')\u001b[m\n\u001b[31m-\u001b[m\n\u001b[31m-Or if you are using factories you can also init it later::\u001b[m\n\u001b[31m-\u001b[m\n\u001b[31m-    from raven.contrib.flask import Sentry\u001b[m\n\u001b[31m-    sentry = Sentry(dsn='YOUR_DSN_HERE')\u001b[m\n\u001b[31m-\u001b[m\n\u001b[31m-    def create_app():\u001b[m\n\u001b[31m-        app = Flask(__name__)\u001b[m\n\u001b[31m-        sentry.init_app(app)\u001b[m\n\u001b[31m-        ...\u001b[m\n\u001b[31m-        return app\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    import sentry_sdk\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    from sentry_sdk.integrations.flask import FlaskIntegration\u001b[m\n\u001b[32m+\u001b[m\u001b[41m    \u001b[m\n\u001b[32m+\u001b[m\u001b[32m    sentry_sdk.init('YOUR_DSN_HERE',integrations=[FlaskIntegration()])\u001b[m\n\u001b[31m-Afterwards failures are automatically reported to Sentry and from there\u001b[m\n\u001b[31m-you can receive error notifications.\u001b[m\n\u001b[32m+\u001b[m\u001b[32mAfter installation, failures leading to an Internal Server Error are automatically reported to\u001b[m\u001b[41m \u001b[m\n\u001b[32m+\u001b[m\u001b[32mSentry and from there you can receive error notifications. Sentry also supports\u001b[m\u001b[41m \u001b[m\n\u001b[32m+\u001b[m\u001b[32mcapturing custom exceptions::\u001b[m\n\u001b[32m+\u001b[m\u001b[41m    \u001b[m\n\u001b[32m+\u001b[m\u001b[32m    import sentry_sdk\u001b[m\n\u001b[32m+\u001b[m\u001b[41m    \u001b[m\n\u001b[32m+\u001b[m\u001b[32m    try:\u001b[m\n\u001b[32m+\u001b[m\u001b[32m        throwing_function()\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    except Exception as e:\u001b[m\n\u001b[32m+\u001b[m\u001b[32m        with sentry_sdk.push_scope() as scope:\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            sentry_sdk.capture_exception(e)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mSee the `Python <https://docs.sentry.io/platforms/python/>`_ and `Flask-specific <https://docs.sentry.io/platforms/python/flask/>`_\u001b[m\u001b[41m \u001b[m\n\u001b[32m+\u001b[m\u001b[32mSentry SDK documentation for more detailed information.\u001b[m\n",
