                  "\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    :param name: the name of the Blueprint\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    :param import_name: the name of the Blueprint package, __name__ most of the time.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            The module folder will be the blueprint resource folder by default.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    :param static_folder: you can serve your Blueprint static files by setting `static_folder`\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            to the folder with static files to serve at `static_url`.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            The path can be absolute or relative to the Blueprint resource folder\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    :param static_url: the url to serve static files from. Defaults to ``static_folder``.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            If your app's static_url is the same, your Blueprint's files won't be accessible.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    :param template_folder: your blueprint can expose template from this folder by adding this path\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            to the search path of templates. The path can be absolute or relative to\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            the Blueprint resource folder.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    :param url_prefix: url to prefix all the Blueprint routes.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    :param subdomain: If set up, Blueprint routes will match on this subdomain.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    :param url_defaults: Blueprint routes will use these default values for\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            view arguments.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    :param root_path: you can specify a different root_path than the module folder.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            to become your Blueprint resource folder.\u001b[m\n",
