                rawChanges:
                  "\u001b[31m-A compact representation for lossless serialization of non-standard JSON types.\u001b[m\n\u001b[31m-:class:`~flask.sessions.SecureCookieSessionInterface` uses this to serialize\u001b[m\n\u001b[31m-the session data, but it may be useful in other places. It can be extended to\u001b[m\n\u001b[31m-support other types.\u001b[m\n\u001b[32m+\u001b[m\u001b[32mA compact representation for lossless serialization of non-standard JSON\u001b[m\n\u001b[32m+\u001b[m\u001b[32mtypes. :class:`~flask.sessions.SecureCookieSessionInterface` uses this\u001b[m\n\u001b[32m+\u001b[m\u001b[32mto serialize the session data, but it may be useful in other places. It\u001b[m\n\u001b[32m+\u001b[m\u001b[32mcan be extended to support other types.\u001b[m\n\u001b[31m-Let's seen an example that adds support for :class:`~collections.OrderedDict`.\u001b[m\n\u001b[31m-Dicts don't have an order in Python or JSON, so to handle this we will dump\u001b[m\n\u001b[31m-the items as a list of ``[key, value]`` pairs. Subclass :class:`JSONTag` and\u001b[m\n\u001b[31m-give it the new key ``' od'`` to identify the type. The session serializer\u001b[m\n\u001b[31m-processes dicts first, so insert the new tag at the front of the order since\u001b[m\n\u001b[31m-``OrderedDict`` must be processed before ``dict``. ::\u001b[m\n\u001b[32m+\u001b[m\u001b[32mLet's see an example that adds support for\u001b[m\n\u001b[32m+\u001b[m\u001b[32m:class:`~collections.OrderedDict`. Dicts don't have an order in JSON, so\u001b[m\n\u001b[32m+\u001b[m\u001b[32mto handle this we will dump the items as a list of ``[key, value]``\u001b[m\n\u001b[32m+\u001b[m\u001b[32mpairs. Subclass :class:`JSONTag` and give it the new key ``' od'`` to\u001b[m\n\u001b[32m+\u001b[m\u001b[32midentify the type. The session serializer processes dicts first, so\u001b[m\n\u001b[32m+\u001b[m\u001b[32minsert the new tag at the front of the order since ``OrderedDict`` must\u001b[m\n\u001b[32m+\u001b[m\u001b[32mbe processed before ``dict``.\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m.. code-block:: python\u001b[m\n\u001b[31m-\u001b[m\n\u001b[31m-:copyright: 2010 Pallets\u001b[m\n\u001b[31m-:license: BSD-3-Clause\u001b[m\n",
