                rawChanges:
                  '\u001b[32m+\u001b[m\u001b[32m<p align="center">\u001b[m\n\u001b[32m+\u001b[m\u001b[32m  <a href="https://erebos.xyz/" target="_blank" rel="noopener noreferrer">\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    <img src="https://avatars3.githubusercontent.com/u/59746198?s=200&v=4" alt="Erebos Logo" height="150">\u001b[m\n\u001b[32m+\u001b[m\u001b[32m  </a>\u001b[m\n\u001b[32m+\u001b[m\u001b[32m</p>\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m<h3 align="center">Official code of conflict</h3>\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m## Table of contents\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- [Table of contents](#table-of-contents)\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- [[](#conflicts)Conflicts](#conflictsconflicts)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m## [](#conflicts)Conflicts\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mOur development effort is a very personal process compared\u001b[m\n\u001b[32m+\u001b[m\u001b[32mto "traditional" ways of developing software. Your code and ideas\u001b[m\n\u001b[32m+\u001b[m\u001b[32mbehind it will be carefully reviewed, often resulting in critique and\u001b[m\n\u001b[32m+\u001b[m\u001b[32mcriticism. The review will almost always require improvements to the\u001b[m\n\u001b[32m+\u001b[m\u001b[32mcode before it can be included. Know that this happens because everyone\u001b[m\n\u001b[32m+\u001b[m\u001b[32minvolved wants to see the best possible solution for the overall success\u001b[m\n\u001b[32m+\u001b[m\u001b[32mof this project.\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mAs a reviewer of code, please strive to keep things civil and focused on\u001b[m\n\u001b[32m+\u001b[m\u001b[32mthe technical issues involved. We are all humans, and frustrations can\u001b[m\n\u001b[32m+\u001b[m\u001b[32mbe high on both sides of the process. Try to keep in mind the immortal\u001b[m\n\u001b[32m+\u001b[m\u001b[32mwords of Bill and Ted, "Be excellent to each other."\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mSPDX-License-Identifier: (EUPL-1.2)\u001b[m\n\u001b[32m+\u001b[m\u001b[32mCopyright © 2019-2020 Simon Prast\u001b[m\n',
