                path: "CONTRIBUTING.md",
                rawChanges:
                  '\u001b[32m+\u001b[m\u001b[32m<p align="center">\u001b[m\n\u001b[32m+\u001b[m\u001b[32m  <a href="https://erebos.xyz/" target="_blank" rel="noopener noreferrer">\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    <img src="https://avatars3.githubusercontent.com/u/59746198?s=200&v=4" alt="Erebos Logo" height="150">\u001b[m\n\u001b[32m+\u001b[m\u001b[32m  </a>\u001b[m\n\u001b[32m+\u001b[m\u001b[32m</p>\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m<h3 align="center">Official contributing guidelines</h3>\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m<p align="center">\u001b[m\n\u001b[32m+\u001b[m\u001b[32m  A code of conduct is a set of rules outlining the norms, rules, and responsibilities of,\u001b[m\n\u001b[32m+\u001b[m\u001b[32m  and or proper practices for, an individual.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m</p>\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m## Table of contents\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- [Table of contents](#table-of-contents)\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- [[](#commits)Commits](#commitscommits)\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- [[](#pull-requests)Pull Requests](#pull-requestspull-requests)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m## [](#commits)Commits\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- All commits may start with an uppercase letter\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- All commits must be written in present tense\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- All commits may be multiline commits\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- The commit headline must have a maximum of 71 chars\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- The commit message must have a maxmum of 71 chars per line\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- If possible, include link to online topic as reference (Ref: )\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- Detailed explanation why the commit was done\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- Include reference to issue if one exists\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- All commits must be verified\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- No commits, under no circumstances, should be directly pushed to master (deadly)\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- Each commit should only serve one purpose\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m## [](#pull-requests)Pull Requests\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- Each pull request should only follow one topic\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- You must follow the guidelines / template\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- Each pull request must answer one more more issues\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- Each pull request must have at least one reviewer\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- Each pull request must have at least one assigned developers\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- Each pull request must have a label\u001b[m\n\u001b[32m+\u001b[m\u001b[32m- Each pull request should be merged by a reviewer\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mSPDX-License-Identifier: (EUPL-1.2)\u001b[m\n\u001b[32m+\u001b[m\u001b[32mCopyright © 2019-2020 Simon Prast\u001b[m\n',
