                rawChanges:
                  '\u001b[31m-Common Error Codes\u001b[m\n\u001b[31m-------------------\u001b[m\n\u001b[31m-The following error codes are some that are often displayed to the user,\u001b[m\n\u001b[31m-even if the application behaves correctly:\u001b[m\n\u001b[31m-\u001b[m\n\u001b[31m-*400 Bad Request*\u001b[m\n\u001b[31m-    When the server will not process the request due to something that\u001b[m\n\u001b[31m-    the server perceives to be a client error. Such as malformed request\u001b[m\n\u001b[31m-    syntax, missing query parameters, etc.\u001b[m\n\u001b[31m-\u001b[m\n\u001b[31m-*403 Forbidden*\u001b[m\n\u001b[31m-    If you have some kind of access control on your website, you will have\u001b[m\n\u001b[31m-    to send a 403 code for disallowed resources. So make sure the user\u001b[m\n\u001b[31m-    is not lost when they try to access a forbidden resource.\u001b[m\n\u001b[31m-\u001b[m\n\u001b[31m-*404 Not Found*\u001b[m\n\u001b[31m-    The good old "chap, you made a mistake typing that URL" message. So\u001b[m\n\u001b[31m-    common that even novices to the internet know that 404 means: damn,\u001b[m\n\u001b[31m-    the thing I was looking for is not there. It\'s a very good idea to\u001b[m\n\u001b[31m-    make sure there is actually something useful on a 404 page, at least a\u001b[m\n\u001b[31m-    link back to the index.\u001b[m\n\u001b[31m-\u001b[m\n\u001b[31m-*410 Gone*\u001b[m\n\u001b[31m-    Did you know that there the "404 Not Found" has a brother named "410\u001b[m\n\u001b[31m-    Gone"? Few people actually implement that, but the idea is that\u001b[m\n\u001b[31m-    resources that previously existed and got deleted answer with 410\u001b[m\n\u001b[31m-    instead of 404. If you are not deleting documents permanently from\u001b[m\n\u001b[31m-    the database but just mark them as deleted, do the user a favour and\u001b[m\n\u001b[31m-    use the 410 code instead and display a message that what they were\u001b[m\n\u001b[31m-    looking for was deleted for all eternity.\u001b[m\n\u001b[31m-\u001b[m\n\u001b[31m-*500 Internal Server Error*\u001b[m\n\u001b[31m-    Usually happens on programming errors or if the server is overloaded.\u001b[m\n\u001b[31m-    A terribly good idea is to have a nice page there, because your\u001b[m\n\u001b[31m-    application *will* fail sooner or later.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m.. _error-logging-tools:\u001b[m\n\u001b[31m-To use Sentry you need to install the `sentry-sdk` client with extra `flask` dependencies::\u001b[m\n\u001b[32m+\u001b[m\u001b[32mTo use Sentry you need to install the ``sentry-sdk`` client with extra\u001b[m\n\u001b[32m+\u001b[m\u001b[32m``flask`` dependencies.\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m.. code-block:: text\u001b[m\n\u001b[31m-And then add this to your Flask app::\u001b[m\n\u001b[32m+\u001b[m\u001b[32mAnd then add this to your Flask app:\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m.. code-block:: python\u001b[m\n\u001b[31m-The `YOUR_DSN_HERE` value needs to be replaced with the DSN value you get\u001b[m\n\u001b[31m-from your Sentry installation.\u001b[m\n\u001b[32m+\u001b[m\u001b[32mThe ``YOUR_DSN_HERE`` value needs to be replaced with the DSN value you\u001b[m\n\u001b[32m+\u001b[m\u001b[32mget from your Sentry installation.\u001b[m\n\u001b[31m-Follow-up reads:\u001b[m\n\u001b[32m+\u001b[m\u001b[32mSee also:\u001b[m\n\u001b[31m-* Sentry also supports catching errors from your worker queue (RQ, Celery) in a\u001b[m\n\u001b[31m-  similar fashion. See the `Python SDK docs\u001b[m\n\u001b[31m-  <https://docs.sentry.io/platforms/python/>`_ for more information.\u001b[m\n\u001b[31m-* `Getting started with Sentry <https://docs.sentry.io/quickstart/?platform=python>`_\u001b[m\n\u001b[31m-* `Flask-specific documentation <https://docs.sentry.io/platforms/python/flask/>`_.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m-   Sentry also supports catching errors from a worker queue\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    (RQ, Celery, etc.) in a similar fashion. See the `Python SDK docs\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    <https://docs.sentry.io/platforms/python/>`__ for more information.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m-   `Getting started with Sentry <https://docs.sentry.io/quickstart/?platform=python>`__\u001b[m\n\u001b[32m+\u001b[m\u001b[32m-   `Flask-specific documentation <https://docs.sentry.io/platforms/python/flask/>`__\u001b[m\n\u001b[32m+\u001b[m\u001b[32mWhen an error occurs in Flask, an appropriate `HTTP status code\u001b[m\n\u001b[32m+\u001b[m\u001b[32m<https://developer.mozilla.org/en-US/docs/Web/HTTP/Status>`__ will be\u001b[m\n\u001b[32m+\u001b[m\u001b[32mreturned. 400-499 indicate errors with the client\'s request data, or\u001b[m\n\u001b[32m+\u001b[m\u001b[32mabout the data requested. 500-599 indicate errors with the server or\u001b[m\n\u001b[32m+\u001b[m\u001b[32mapplication itself.\u001b[m\n\u001b[32m+\u001b[m\n',
