                rawChanges:
                  '\u001b[32m+\u001b[m\u001b[32mpackage git\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mimport (\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m"encoding/json"\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m"github.com/snek-at/tools"\u001b[m\n\u001b[32m+\u001b[m\u001b[32m)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// GetLog returns the git log history of the\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// current checked out repository.\u001b[m\n\u001b[32m+\u001b[m\u001b[32m//\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// completelog=false -> Analyze the last commit\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// completelog=true -> Analyze the whole branch\u001b[m\n\u001b[32m+\u001b[m\u001b[32mfunc GetLog(completelog bool) CommitLogStruct {\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mvar logData CommitLogStruct\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mvar filelogData map[string]FilesStruct\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mvar log, filelog string\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mif completelog {\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mlog = tools.ExecuteScript("scripts/git_commit_log.sh", "")\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mfilelog = tools.ExecuteScript("scripts/git_commit_log_files_stat.sh", "")\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m} else {\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mlog = tools.ExecuteScript("scripts/git_commit_log.sh", "1")\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mfilelog = tools.ExecuteScript("scripts/git_commit_log_files_stat.sh", "1")\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32merr := json.Unmarshal([]byte(log), &logData)\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32merr2 := json.Unmarshal([]byte(filelog), &filelogData)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mif err != nil && err2 != nil {\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mpanic(err)\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m// for {key}, {value} := range {list}\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mfor key, entry := range logData {\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mentry.Files = filelogData[entry.Commit]\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mfor i := 0; i < len(entry.Files); i++ {\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\t\t\u001b[32mfileContent := tools.ExecuteScript("scripts/git_commit_changes.sh", entry.Commit, entry.Files[i].Path)\u001b[m\n\u001b[32m+\u001b[m\t\t\t\u001b[32mentry.Files[i].RawChanges = (fileContent)\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mlogData[key] = entry\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mreturn logData\u001b[m\n\u001b[32m+\u001b[m\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// CommitLogStruct defines the structure of a list\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// which items contain information about commits\u001b[m\n\u001b[32m+\u001b[m\u001b[32mtype CommitLogStruct []struct {\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mCommit  string      `json:"commit"`\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mAuthor  string      `json:"author"`\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mDate    string      `json:"date"`\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mMessage string      `json:"message"`\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mFiles   FilesStruct `json:"files"`\u001b[m\n\u001b[32m+\u001b[m\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// FilesStruct defines the structure of a list\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// which items contain information about a specific\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// file\u001b[m\n\u001b[32m+\u001b[m\u001b[32mtype FilesStruct []struct {\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mInsertions string `json:"insertions"`\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mDeletions  string `json:"deletions"`\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mPath       string `json:"path"`\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mRawChanges string `json:"raw_changes"`\u001b[m\n\u001b[32m+\u001b[m\u001b[32m}\u001b[m\n',
