                path: "internal/client/graphql_client.go",
                rawChanges:
                  '\u001b[32m+\u001b[m\u001b[32mpackage client\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mimport (\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m"context"\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m"errors"\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m"fmt"\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m"io/ioutil"\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m"log"\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m"os"\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m"github.com/machinebox/graphql"\u001b[m\n\u001b[32m+\u001b[m\u001b[32m)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32mfunc getEnv(key string) string {\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mif value, ok := os.LookupEnv(key); ok {\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mreturn value\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mlog.Fatal(errors.New(key + " not set"))\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mreturn ""\u001b[m\n\u001b[32m+\u001b[m\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// SendToOPS send a datastring to the OPS SITP endpoint\u001b[m\n\u001b[32m+\u001b[m\u001b[32mfunc SendToOPS(data string) {\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mfmt.Println("GraphQL Client Received Data ")\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mioutil.WriteFile("tmp.json", []byte(data), 0644)\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mfmt.Print(data)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m// assign env vars\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mOPSURL := getEnv("OPS_URL")\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mOPSTOKEN := getEnv("OPS_TOKEN")\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m// create a client (safe to share across requests)\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mclient := graphql.NewClient(OPSURL)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m// make a request\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mreq := graphql.NewRequest(`\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    query ($token: String!, $key: String!) {\u001b[m\n\u001b[32m+\u001b[m\u001b[32m        items (id:$key) {\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            field1\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            field2\u001b[m\n\u001b[32m+\u001b[m\u001b[32m            field3\u001b[m\n\u001b[32m+\u001b[m\u001b[32m        }\u001b[m\n\u001b[32m+\u001b[m\u001b[32m    }\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m`)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m// set any variables\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mreq.Var("token", OPSTOKEN)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m// set header fields\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mreq.Header.Set("Authorization", OPSTOKEN)\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m// define a Context for the request\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m// Ref: https://golang.org/pkg/context/\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mctx := context.Background()\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m// run it and capture the response\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mvar respData ResponseStruct\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32mif err := client.Run(ctx, req, &respData); err != nil {\u001b[m\n\u001b[32m+\u001b[m\t\t\u001b[32mlog.Fatal(err)\u001b[m\n\u001b[32m+\u001b[m\t\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\u001b[32m}\u001b[m\n\u001b[32m+\u001b[m\n\u001b[32m+\u001b[m\u001b[32m// ResponseStruct not defined yet\u001b[m\n\u001b[32m+\u001b[m\u001b[32mtype ResponseStruct struct{}\u001b[m\n',
                __typename: "ContributionFile",
